import React, {useState} from "react";
import "./List.css";
import * as restaurantData from "./data/restaurant.json";
import Card from "./Card";

const List = props => {

    const checkRestaurant = (restaurant) => {
        return restaurant.ratings.stars >= 4;
      }

    var restaurantDisplay = restaurantData.features.filter(checkRestaurant);
    console.log(restaurantDisplay);

    return(restaurantData ?
        <ul className="list">
            {restaurantData.features.map(restaurant => (
                <Card display={true} displayDetails={false} restaurant={restaurant} />
            ))}
        </ul>
    : <div>Chargement du restaurant...</div>);
}

export default List;
